import styles from './Things.module.css';

const Things = () => (
    <div className={styles.container}>
        <h3>Articles</h3>
        <h3>Podcasts</h3>
        <h3>Videos</h3>
        <h3>Interviews</h3>
    </div>
);

export default Things;
